// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract CTToken is ERC20 {
    struct AddressInfo {
        bool isEnterprise;    //是否为企业用户
        bool isDistributed;   //本年度是否已分配碳配额
    }

    uint256 constant public CT_DEFAULT = 1000;   //暂定一个默认值
    bytes32 public merkleRoot;    //默克尔树根值
    mapping(address => bool) public isAddressInMerkleTree;   //地址是否在merkel树中
    mapping(address => uint256) public debts;  //欠款字段
    mapping(address => AddressInfo) private addressInfo;    //用户信息
    uint256 private currentYear; //当前年份
    address private admin; //
    constructor() payable ERC20("CT", "CT") {
        _mint(msg.sender, 1000000 * (10 ** decimals()));
        admin = msg.sender;
        currentYear = 1;
    }

    function setAddressInfo(address[] memory addresses, bool[] memory isEnterprise) external {
        require(addresses.length == isEnterprise.length, "Invalid input");

        for (uint256 i = 0; i < addresses.length; i++) {
            address addr = addresses[i];
            addressInfo[addr].isEnterprise = isEnterprise[i];
        }
    }

    function distributeTokens(address[] memory addresses, uint256[] memory amounts) external {
        require(addresses.length == amounts.length, "Invalid input");  //有效性判断

        for (uint256 i = 0; i < addresses.length; i++) {
            require(amounts[i] > 0, "Amount must be greater than zero");  

            address recipient = addresses[i];       //获取每个地址的地址及要分配的CT数量
            uint256 amount = amounts[i];

            require(!addressInfo[recipient].isDistributed, "Tokens already distributed for this year");

            if (addressInfo[recipient].isEnterprise) {
                // 分配给企业账户
                _transfer(msg.sender, recipient, CT_DEFAULT);   //暂时使用一个默认值
            } else {
                // 分配给个人账户
                _transfer(msg.sender, recipient, CT_DEFAULT);
            }

            addressInfo[recipient].isDistributed = true;
        }
    }

    function nextYear() external {
        currentYear++;
        // resetDistributionStatus();
    }

    // function resetDistributionStatus() private {
    //     for (uint256 i = 0; i < addresses.length; i++) {
    //         addressInfo[addresses[i]].isDistributed = false;
    //     }
    // }

    //核算
    function settleAccounts(address user, uint256 amount) public {
        require(msg.sender == address(this), "Only contract owner can call this function");

        if (balanceOf(user) >= amount) {                //如果余额足够
            _transfer(user,admin,amount);
        } else {
            _transfer(user,admin,balanceOf(user));
            debts[user] += amount - balanceOf(user) ;

        }
    }
    function transferETHToExternalAccount(address payable recipient, uint256 amount) external {
        recipient.transfer(amount); 
    }
    receive() external payable {
        // 这个函数将会在转入 ETH 时被触发
    }
    // 将外部账户的 ETH 转入合约账户
    function depositETH() external payable {}
    function getContractBalance() public view returns (uint256) {
        return address(this).balance;
    }
}

